INSERT INTO `product` (`ProductId`, `ProductBrand`, `Description`, `Price`, `Image`, `Rating`, `CategoryId`) VALUES
(1, 'American Eagle', 'The Classic Polo Shirt epitomizes timeless elegance and casual sophistication. Crafted with meticulous attention to detail, this wardrobe essential seamlessly blends comfort with style. Its enduring design features a ribbed collar and cuffs, adding a touch of refinement to its laid-back charm. The high-quality cotton fabric ensures a luxuriously soft feel against the skin, providing comfort throughout the day.\n\nThe three-button placket adds a subtle element of versatility, allowing you to adjust the neckline to your preference. The tailored fit offers a flattering silhouette, making it a versatile choice for various occasions â€“ from casual Fridays at the office to weekend outings with friends. The embroidered logo on the chest discreetly communicates a sense of brand authenticity and quality.\n\nWhether paired with chinos for a smart-casual look or worn with shorts for a relaxed vibe, the Classic Polo Shirt effortlessly elevates your ensemble. Embrace the enduring appeal of this wardrobe staple, where timeless design meets modern comfort.', 360, , 5, 1);
