INSERT INTO `product` (`ProductId`, `ProductBrand`, `Description`, `Price`, `Image`, `Rating`, `CategoryId`) VALUES
(5, 'Adidas', 'The Adidas Cotton T-shirt is a perfect fusion of comfort, style, and sporty flair. Crafted from premium-quality cotton, it provides a soft and breathable feel, ensuring all-day comfort whether you\'re hitting the gym or navigating a casual day out. The classic crew neckline and short sleeves offer a timeless and versatile design, making it an essential wardrobe staple.\n\nAdidas\'s iconic logo, subtly embroidered or printed on the chest, adds a touch of authenticity and athletic sophistication. The shirt\'s relaxed fit allows for unrestricted movement, making it an ideal choice for both active pursuits and leisurely activities. The cotton fabric not only feels great against the skin but also wicks away moisture, keeping you cool and dry during workouts or warm days.\n\nAvailable in a variety of colors, the Adidas Cotton T-shirt effortlessly complements your personal style while showcasing the brand\'s commitment to quality and performance. Whether paired with shorts, joggers, or jeans, this T-shirt effortlessly transitions from the workout session to casual social occasions, embodying the perfect blend of comfort and athletic aesthetics. Elevate your everyday wardrobe with the timeless appeal of Adidas\'s cotton T-shirt.', 800, , 5, 1);
