INSERT INTO `product` (`ProductId`, `ProductBrand`, `Description`, `Price`, `Image`, `Rating`, `CategoryId`) VALUES
(9, 'Pull&Bear', '\nPull & Bear shirts embody a fusion of modern style and casual comfort. Crafted with attention to detail, the collection features a variety of designs, from classic button-downs to trendy prints. The shirts boast quality fabrics for a soft feel, ensuring all-day wearability. With a diverse range of patterns and colors, Pull & Bear caters to individual tastes, allowing for easy wardrobe integration. The shirts often showcase contemporary fits, balancing style and relaxation. Unique details, like distinctive buttons or subtle logos, add character to each piece. Versatile enough for casual outings or more polished occasions, Pull & Bear shirts are a go-to for those seeking trendy yet comfortable fashion. Elevate your wardrobe with these statement pieces that effortlessly reflect the dynamic lifestyle of the modern individual.', 500, , 1, 2);
